import * as React from 'react';
import 'rsuite/dist/styles/rsuite-default.css';
import {FooterV} from './src';
import SocialIcon2 from './src/components/SocialIcon2';

const Footer=()=>{
  return(
  <FooterV isSocialicon={<SocialIcon2/>} />
  );
};

export default Footer;
